l: 0,2L/min - aproximada (100cmH2O); O reanimador deve possuir capacidade de funcionamento correto tanto em condições climáticas comuns, quanto sob temperaturas extremas (adequada à realidade climática do Brasil); Temperatura de armazenamento de -5º C a 70º C. Da Válvula: Deve conter válvula de paciente que impeça o retorno do fluxo do ar exalado pelo paciente para o balão do ressuscitador; Sistema de válvula com obturador único que melhora a visibilidade e o manuseio do fluxo de ar ao paciente; O conector deverá permitir o giro da máscara em 360º, nos dois sentidos; Conector do paciente: 22/15mm (ISO); Conector expiratório: 30mm MACHO (ISO) - para conexão de válvula PEEP. Espaço morto: <7ml; Resistência inspiratória: 50L/min - aproximada: -3,5 cmH2O; Resistência expiratória: 50L/min aproximada: 2,6 cmH2O; Sistema de limitação de pressão: da elasticidade da bolsa que limita a pressão das vias respiratórias em aproximadamente (80cmH2O) numa compressão normal. Do Reservatório: O sistema de reservatório deve assegurar a otimização do oxigênio utilizado; A Bolsa Reservatório de oxigênio com volume mínimo de 1500ml, de forma a permitir o fornecimento de altas concentrações de oxigênio ao paciente; Autoclavável entre 121 a 134º C. Da Máscara: A máscara deve ser feita em polisulfona transparente, para permitir a detecção de regurgitação, cianose e respiração espontânea; Coxim deve ser inflável em silicone, totalmente isenta de látex; Deve acompanhar três máscaras com tamanho adequado para paciente adulto pequeno, adulto médio e adulto grande. Da Esterilização: Todos os componentes devem ser autoclaváveis em temperatura de 121ºC a 134ºC, inclusive o reservatório de oxigênio tipo bolsa.','TB'),(12807,'REANIMADOR PULMONAR PEDIÁTRICO - TOTALMENTE AUTOCLAVÁVEL. Características Adicionais: Totalmente autoclavável à temperatura de 121 a 134º C, garantindo sua reutilização; Bojo deve ser de fácil manuseio e possuir características ergonômicas que possibilitem ao profissional realizar o procedimento; Bojo pediátrico, deve permitir ventilação adequada ao paciente com peso corporal inferior a 30kg; Deve ter capacidade máxima de 750ml; O sistema deverá permitir a entrega de no mínimo 85% de FIO2 se ligado a um fluxo de oxigênio de 3 a 5 litros por minuto; Deve oferecer um volume de ventilação de no máximo 400ml; Máxima pressão de descarga alcançável: 0,2L/min - aproximada (50 cmH2O); O reanimador deve possuir capacidade de funcionamento correto tanto em condições climáticas comuns, quanto sob temperaturas extremas (adequadas à realidade climática do Brasil); Temperatura de armazenamento de -5ºC a 70ºC. Da Válvula: Deve conter válvula que impeça o retorno do fluxo do ar exalado pelo paciente para o balão do ressuscitador; Deve possuir válvula tipo Pop-Off com limite de pressão ajustável. Quando necessário, permite regulagem ou bloqueio da válvula limitadora de pressão em 40 cmH2O - 60 cmH2O; Sistema de válvula com obturador único que melhora a visibilidade e o manuseio do fluxo de ar ao paciente; O conector deverá permitir o giro da máscara em 360º, nos dois sentidos; Conector expiratório (para a válvula PEEP acoplada): 30mm MACHO (ISO). Espaço morto: menor que 7ml; Resistência inspiratória: (com ou sem o tubo de depósito de oxigênio) 50L/min aproximada -3,8 cmH2O e a 5L/min aproximada -0,8 cmH2O. Resistência expiratória: 50L/min aproximado: 4,5 cmH2O e a 5L/min aproximada 0,6 cmH2O; Sistema de limitação de pressão: da elasticidade da bolsa que limita a pressão das vias respiratórias em aproximadamente (80cmH2O) numa compressão normal; Conector do paciente: 22/15mm (universal - ISO). Máxima pressão de descarga alcançável quando a válvula limitadora de pressão é anulada: de aproximadamente 100cmH2O; abertura do limitador de pressão da válvula com máximo de 45 cmH2O. Caso haja excesso de pressão, a elasticidade da tampa externa deve limitar a pressão de ar ao máximo de 4,8Kpa (48 cmH2O). Do Reservatório: O sistema de reservatório deve assegurar a otimização do oxigênio utilizado, de forma a permitir o fornecimento de altas concentrações de oxigênio ao paciente; Reservatório de oxigênio tipo bolsa com volume mínimo de 1000ml; Resistência inspiratória da bolsa do reservatório de oxigênio: a 50L/min aproximado: -1,0 cmH2O a 5L/min; Autoclavável entre 121 a 134º C. Da Máscara: A máscara deve ser feita em polisulfona transparente, para permitir a detecção de regurgitação, cianose e respiração espontânea; Coxim deve ser inflável em silicone, totalmente isenta de látex; Deve acompanhar três máscaras com tamanho adequado para paciente infantil e pediátrico. Da Esterilização: Todos os componentes devem ser autoclaváveis em temperatura de 121ºC a 134ºC, inclusive o reservatório de oxigênio tipo bolsa.','TB'),(12809,'COLA; Material: plástica; apresentação: adesivo instantâneo; Aplicação: múltipla; Unidade de fornecimento: tubo com 03 gramas.','TB'),(12814,'MASCARA DE NAO-REINALAÇAO - MODELO ADULTO SISTEMA COMPLETO, Tamanho: adulto, Características Adicionais: máscara para oxigenioterapia em vinil macio e transparente facilitando avaliação visual, com presilha ajustável de nariz para fixação confortável. Faixa elástica ajustável à face do paciente. Válvula de controle de baixa resistência, previne a reinalação de gases e duas membranas na máscara permitem a eliminação do gás exalado. Sistema completo, com bolsa reservatória de capacidade mínima de 750ml e tubo de suprimento de oxigênio com no mínimo 2,00m de comprimento. Permite terapia com até 100% de O2.','UN'),(12822,'TERMÔMETRO DIGITAL PARA GELADEIRA, FREEZER E ESTUFA, Temperaturas de Trabalho: de -50º C a + 70º C, Características Adicionais: com diplay em cristal com indicação de temperatura ambiente, temperatura de máximo e mínimo e alarme sonoro, com indicação sonora caso a temperatura interna da geladeira ou freezer ultrapasse os parâmetros configurados, memória máxima e mínima, acompanhado de adesivo velcro e magnetos para uso fora da geladeira ou freezer, 1 sen